html {
  font-family: sans-serif;
}

table {
  border-collapse: collapse;
  border: 2px solid rgb(200,200,200);
  letter-spacing: 1px;
  font-size: 0.8rem;
}

td, th {
  border: 1px solid rgb(190,190,190);
  padding: 10px 20px;
}

th {
  background-color: rgb(235,235,235);
}

td {
  text-align: center;
}

tr:nth-child(even) td {
  background-color: rgb(250,250,250);
}

tr:nth-child(odd) td {
  background-color: rgb(245,245,245);
}

caption {
  padding: 10px;
}
.companyLogo {
    /* Ping Logo  */
    content: url("https://assets.pingone.com/ux/ui-library/5.0.2/images/logo-pingidentity.png");
    width: 65px;
    height: 65px;
  }

.mainDiv {
    max-width: 400px; 
    min-width: 400px;
    width: 100%
}

/* Break out into individual classes as needed */
.magicLinkDiv,
.otpDiv,
.signInDiv,
.successDiv,
.totpDiv,
.registrationDiv{
    max-width: 400px; 
    min-width: 400px;
    width: 100%
}

.deviceSelectionDiv {
    max-width: 500px; 
    min-width: 500px;
    width: 100%
}

